import "./DataGrid.css";

const DataGrid = (props) => {
 
  return (
    <div className="datagrid-container">
      
      <table>
        <tbody>
          <tr>
            <th>Employee ID #1</th>
            <th>Employee ID #2</th>
            <th>Project ID</th>
            <th>Days worked</th>
          </tr>
          <tr>
            <td>{props.employeeStats.employeeOne}</td>
            <td>{props.employeeStats.employeeTwo}</td>
            <td>{props.employeeStats.projectID}</td>
            <td>{props.employeeStats.daysWorkedTogether}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default DataGrid;
